StyxHub.Commands = {}
for i = 1, 100 do
    StyxHub.Commands["cmd" .. i] = {
        description = "This is command #" .. i,
        permission = "user",
        execute = function(args) end
    }
end

StyxHub.DefaultSettings = {}
for i = 1, 50 do
    StyxHub.DefaultSettings["setting" .. i] = {
        value = false,
        description = "No-op setting",
        locked = false
    }
end

